CREATE TABLE demo_positions
(
  id BIGINT PRIMARY KEY NOT NULL AUTO_INCREMENT,
  altitude DOUBLE,
  command VARCHAR(10),
  course DOUBLE,
  device_id BIGINT,
  extended_info LONGTEXT,
  latitude DOUBLE,
  longitude DOUBLE,
  speed DOUBLE,
  time TIMESTAMP,
  valid BIT,
  battery VARCHAR(3),
  actual BIT,
  FOREIGN KEY (device_id) REFERENCES device (id)
);
CREATE INDEX FK_demo_positions_device ON demo_positions (device_id);



















